import React, { useState, useEffect } from "react";
import { useNavigate } from "react-router-dom";
import { ToastContainer, toast } from "react-toastify";
import "react-toastify/dist/ReactToastify.css";
import axios from "axios";
import { FaUserCircle, FaSignOutAlt, FaTrash } from "react-icons/fa";
import styles from "../sDashboard.css"; // Adjust path if needed

const Dashboard = () => {
  const [user, setUser] = useState(null);
  const [clubs, setClubs] = useState([]);
  const [events, setEvents] = useState([]);
  const [resources, setResources] = useState([]);
  const [showMenu, setShowMenu] = useState(false);
  const navigate = useNavigate();

  useEffect(() => {
    const fetchUserData = async () => {
      const token = localStorage.getItem("token");

      if (!token) {
        navigate("/login");
        return;
      }

      try {
        const response = await axios.get("http://localhost:8000/dashboard", {
          headers: {
            Authorization: `Bearer ${token}`,
          },
        });

        if (response.data.success) {
          setUser(response.data.user); // Store user data
        } else {
          toast.error(response.data.message || "Failed to fetch user data.");
        }
      } catch (error) {
        toast.error("An error occurred during fetch.");
      }
    };

    const fetchClubs = async () => {
      try {
        const response = await axios.get("http://localhost:8000/clubs/all");
        setClubs(response.data.clubs);
      } catch (error) {
        toast.error("Failed to fetch clubs.");
      }
    };

    const fetchEvents = async () => {
      try {
        const response = await axios.get("http://localhost:8000/events/all");
        setEvents(response.data.events);
      } catch (error) {
        toast.error("Failed to fetch events.");
      }
    };

    const fetchResources = async () => {
      try {
        const response = await axios.get("http://localhost:8000/resources/all");
        setResources(response.data.resources);
      } catch (error) {
        toast.error("Failed to fetch resources.");
      }
    };

    fetchUserData();
    fetchClubs();
    fetchEvents();
    fetchResources();
  }, [navigate]);

  const handleLogout = () => {
    localStorage.removeItem("token");
    navigate("/login");
  };

  const handleDeleteAccount = async () => {
    const token = localStorage.getItem("token");

    if (!token) {
      toast.error("You need to log in first.");
      return;
    }

    try {
      const response = await axios.delete("http://localhost:8000/delete-account", {
        headers: {
          Authorization: `Bearer ${token}`,
        },
      });
      toast.success(response.data.message);
      localStorage.removeItem("token");
      navigate("/login");
    } catch (error) {
      toast.error("Failed to delete account.");
    }
  };

  return (
    <div className={styles.container}>
      <div className={styles.header}>
        <FaUserCircle className={styles.icon} />
        <span className={styles.username}>{user ? `Welcome, ${user.name}` : "Loading..."}</span>
        <FaSignOutAlt className={styles.icon} onClick={handleLogout} />
      </div>

      {showMenu && (
        <div className={styles.dropdownMenu}>
          <p onClick={() => navigate("/profile")}>Profile</p>
          <p onClick={handleDeleteAccount}>
            <FaTrash /> Delete Account
          </p>
        </div>
      )}

      <div className={styles.content}>
        <h3>Clubs</h3>
        <ul>
          {clubs.map((club) => (
            <li key={club.club_id}>{club.club_name}</li>
          ))}
        </ul>

        <h3>Events</h3>
        <ul>
          {events.map((event) => (
            <li key={event.event_id}>{event.event_name}</li>
          ))}
        </ul>

        <h3>Resources</h3>
        <ul>
          {resources.map((resource) => (
            <li key={resource.resource_id}>{resource.resource_name}</li>
          ))}
        </ul>
      </div>

      <ToastContainer />
    </div>
  );
};

export default Dashboard;
